import { useEffect, useState } from "react";
import { connect } from "react-redux";
import showUsers from "../../redux/actions/showUsers";

const ShowUsers = (props) => {
  const [users, setUsers] = useState([])
  const { usersShow } = props;

  const getUsers = () => {
    props.showUsers()
  }

  useEffect(() => { 
    getUsers().then((results) => setUsers(results)
    )
  }, [results]);

  console.log(users.length)
return (<div>
    {users.map((user)=> {
      return (<li>{user.map}</li>)
    })}
  </div>)
}

const mapStateToProps = (state) => {
  return {
    usersShow: state.usersShow,
  };
};

const mapDispatchToProps = {
  showUsers,
};

export default connect(mapStateToProps, mapDispatchToProps)(ShowUsers);
